import { Address } from "./address.model";
import { Company } from "./company.model";

interface IUsuario {

    id?:number;
    name?: string;
    username?: string;
    email?: string;
    address?: Address;
    phone?: string;
    website?: string;
    company?: Company;
}

export class Usuario implements IUsuario{
    id?:number;
    name?: string;
    username?: string;
    email?: string;
    address?: Address;
    phone?: string;
    website?: string;
    company?: Company;
}
